import React from "react";
import { Link } from "react-router-dom";

export default function PrevButton(qCount) {
    if (qCount === 0) {
        return (
            <Link className="btn col-2 btn-danger py-3" to="/">
                Home
            </Link>
        );
    }
    return (
        <button
            className="btn col-2 btn-danger py-3"
            onClick={e => {
                e.preventDefault();
                props.prev(true);
            }}
        >
            Prev
        </button>
    );
}
